import React from 'react'

export default function Header() {
  return (
    <div>
        <div className="headertext">
            <span>Create</span>
        <h1>Create</h1>
        <span></span>
        </div>
        
        <img className="" src="https://images.unsplash.com/photo-1643148636637-58b3eb95cdad?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1yZWxhdGVkfDE0fHx8ZW58MHx8fHx8&w=1000&q=80" alt="unsplash_img" />
    </div>
  )
}
